import base64

# Suponiendo que tienes el contenido base64 en una variable
contenido_base64 = ""  # reemplaza con el contenido real
decoded_bytes = base64.b64decode(contenido_base64)

# Guarda como PDF (o XML, según corresponda)
with open('documento_generado.pdf', 'wb') as f:
    f.write(decoded_bytes)
